import React from "react";
import List from "react-bootstrap";

export default function CourierList({ couriers }) {
  function renderCouriers() {
    return couriers.map((courier, i) => {
      return <ListGroup>
          
          <li key={i}>{courier.name}</li>
      <li key={i}>{courier.destination}</li>
      <li key={i}>{courier.date}</li>
      
      </ListGroup>;
    });
  }
 
  return (
    <div>
      <ul>{renderCouriers()}</ul>
    </div>
  );
}
